import React from 'react'
import { List } from 'antd';
import {MailOutlined} from '@ant-design/icons'


const Meta = ({userMeta}) => {
    return (
        <List header="User Meta" itemLayout="horizontal">
             <List.Item>
                <List.Item.Meta
                avatar={<MailOutlined />}
                title={userMeta.email}
                />
            </List.Item>

    </List>
    )
}

export default Meta
